import React from 'react';
import {  Link } from "react-router-dom";

const Navbar = () => {
  return (

    <div class = "flex sm:flex-wrap flex-col items-center justify-center mt-5 sm:gap-x-14 sm:text-2xl text-darkGreen text-xl gap-x-8">
        <div>
          <Link to="/">Home</Link>
        </div>

        <div>
          <Link to="/exp">Experience</Link>
        </div>

        <div>
          <Link to="/contact">Contact</Link>    
        </div>
    </div>

  );
}

export default Navbar;
